    return (<div>
            {!props.IsMyPage ?
                <div>
                    {!ChosedSendMessage ?
                        <div>
                <button onClick={MessageSendingModON}>
                Send message to {props.UserName}
                </button>
                        </div>
                        :
                        <div>

                        </div>
                    }
                </div>
                : ""
            }
        </div>
    )
}


